import React from "react";
import PopupWithForm from "../PopupWithForm/PopupWithForm";

function ConfirmDeletePopup() {
  function handleSubmit(evt) {
    evt.preventDefault();
  }

  return (
    <PopupWithForm
      name="confirm"
      title="Вы уверены?"
      onSubmit={handleSubmit}
    />
  );
}

export default ConfirmDeletePopup;
